import styled from './Header.module.css';
import { Link } from "react-router-dom"




function Header() {
    return (
        <header className={styled.header}>
            <Link to="/">
                <section>
                    <span>Men√∫</span>
                </section>
            </Link>
        </header> 

    )
}

export default Header;
